	module.exports = "<div>\n  Welcome to the official Angular Formly website!\n  Feel free to stick around here and browse/play with the examples.\n  <div>\n    <h2>Features</h2>\n    <ul>\n      <li>\n        <a ng-href=\"{{::vm.docs('custom-templates#prebuilt-templates')}}\">Prebuilt templates</a>\n        for\n        <span ng-repeat=\"prebuilt in ::vm.prebuiltTemplates\">\n          <span ng-if=\"::$last\">and</span>\n          <a ng-href=\"{{::vm.base('-templates-' + prebuilt.suffix)}}\">{{::prebuilt.name}}</a><span ng-if=\"::!$last\">,</span>\n        </span>\n        and WIP template libraries for\n        <span ng-repeat=\"prebuilt in ::vm.wipTemplates\">\n          <span ng-if=\"::$last\">and</span>\n          <a ng-href=\"{{::vm.base('-templates-' + prebuilt.suffix)}}\">{{::prebuilt.name}}</a><span ng-if=\"::!$last\">,</span>\n        </span>\n      </li>\n      <li>\n        Simpler than cake\n        <a ng-href=\"{{::vm.docs('custom-templates')}}\">do it yourself templates</a>\n        through the <code>formlyConfig</code> service.\n      </li>\n      <li>\n        Totally\n        <a ng-href=\"{{::vm.docs('formly-form#field-config')}}\">customizable fields</a>\n        (specify model for the form or for a specific field)\n      </li>\n      <li>\n        <a ng-href=\"{{::vm.docs('formlyconfig#setwrapper')}}\">\n          Template Wrappers\n        </a>\n        make it very easy reduce the amount of boilerplate in your template code so you can maintain a consistent style\n        without running into a maintainence nightmare\n      </li>\n      <li ng-init=\"resetModel={category: 'form-options', slug: 'reset-model'}\">\n        Easy <a fd-event-navigate=\"navigateToExample(resetModel)\">Reset Model</a> functionality.\n      </li>\n      <li>\n        <a ng-href=\"{{::vm.docs('formlyconfig#templatemanipulators')}}\">Template manipulators</a>\n        which allow you to modify templates programmatically. This comes with\n        <a ng-href=\"{{::vm.docs('ngmodelattrstemplatemanipulator')}}\">\n          a built-in template manipulator\n        </a>\n        which will automatically add attributes like `ng-required` or `ng-blur` when the field's config\n        specifies such a requirement which reduces the cruft in your templates as well as the number of watchers for\n        your forms considerably.\n      </li>\n      <li>\n        Take advantage of angular's validators api, whether you're using 1.2 or 1.3, with formly's super simple\n        <a ng-href=\"{{::vm.docs('validation')}}\">validators api</a> with simple string\n        expressions, advanced functions, and async validation support (in both 1.2 and 1.3).\n      </li>\n      <li>\n        <a ng-href=\"{{::vm.docs('formly-form#expressionproperties-object-')}}\"><code>expressionProperties</code></a>\n        makes it super easy to manipulate the fields as the user interacts with your app\n      </li>\n      <li>\n        Warnings logged and errors thrown to ensure you're using formly correctly. Links provided so you can resolve the\n        issue quickly. We'll help you be effective with angular-formly :-D\n      </li>\n      <li>\n        If you're using Angular 1.3, then you can take advantage of the <code>ng-model-options</code> directive via\n        <a ng-href=\"{{::vm.docs('formly-form#modeloptions-object-')}}\">modelOptions</a>.\n      </li>\n      <li>\n        <code>defaultOptions</code> for field types, allowing for as DRY code as possible.\n      </li>\n      <li>\n        Custom <code>link</code> and <code>controller</code> functions per type and/or field, giving maximum control,\n        without having to create a custom directive to add functionality.\n      </li>\n      <li>\n        <a ng-href=\"{{::vm.docs('formly-form#watcher-object-array-of-watches-')}}\">Custom watchers</a>\n        with an enhanced API give you total control when you need it\n      </li>\n    </ul>\n  </div>\n  <div>\n    <h2>The Gist</h2>\n    <div class=\"+font-size-large\">\n      Maintain <strong>less html</strong> in favor of <strong>JavaScript</strong>\n    </div>\n    <hr/>\n\n    <div>\n      Go from this (copied from <a href=\"http://getbootstrap.com/css/#forms\">getbootstrap.com</a>):\n      <div hljs language=\"html\" class=\"+margin-top-small\" source=\"::vm.bootstrapHtml\"></div>\n      <hr/>\n      To this:\n      <div hljs languge=\"html\" class=\"+margin-top-small\" source=\"::vm.formlyHtml\"></div>\n      <div class=\"+margin-top-small\">\n        and the power of JavaScript\n      </div>\n      <div hljs language=\"javascript\" class=\"+margin-top-small\" source=\"::vm.formlyJs\"></div>\n    </div>\n\n    <hr/>\n    <div>\n      And that's not where it gets really cool. We haven't even addressed\n      validation, user interaction, etc, etc, etc...\n    </div>\n\n    <hr/>\n\n    <div class=\"+font-size-large\">\n      So take a look around and catch us on <a ng-href=\"{{::vm.base()}}\">GitHub</a>\n    </div>\n\n  </div>\n  <div>\n    <h2>Introduction Example</h2>\n    <fd-jsbin-example jsbin-id=\"kunaho\"></fd-jsbin-example>\n  </div>\n\n</div>\n"

